import Card from './Card';

export default function Cards({characters}) {
   return (<div>
      {characters.map(char=>{
         return <Card
         name= {char.name}
         species={char.species}
         gender= {char.gender}
         image={char.image}
         onClose={()=>window.alert('Emulando el cierre')}></Card>
      })
   }
   </div>
)
}
